문서: 스티브 놀란 출판: 2013년 8월 30일 EST 07:40 | 업데이트: 2013년 8월 30일 EST 10:00 전 정부 비밀을 유출한 혐의로 징역형을 선고받은 첼시 매닝은 여성으로 살기를 원한다는 발언 이후 감옥에서 잘 지내고 있다. 이에 대해 그녀의 변호사는 "입문 단계에서 잘 지내고 있다"며 "그녀와 수요일에 대화를 나눴다"고 밝혔다. 첼시 매닝은 현재 캔자스 주 포트 리븐워스 군사 감옥에서 세~네 주간의 '교육' 과정을 거치며, 그동안 전 남성 이름인 브래들리로 알려졌던 그녀는 성병증 치료 등 여러 가지 처치를 받기 위해 각종 검사를 받게 될 예정이라 한다.
@highlight
전 남성 이름인 브래들리로 알려진 첼시 매닝, 징역형 선고
@highlight
정부 비밀 유출 혐의로 체포된 매닝, 위키리크스 웹사이트에 정보 제공
@highlight
매닝 변호사 데이비드 쿰스, 그녀와 수요일 대화 나눔
@highlight
쿰스 변호사, 감옥 의료진과 매닝 성전환 수술 등 검토 예정

