(CNN) -- "호빗" 열풍이 뉴질랜드 전역에 휩싸였습니다. J.R.R. 톨킨의 작품을 바탕으로한 피터 잭슨 감독의 세 영화 모두가 뉴질랜드에서 촬영되었습니다. 웰링턴 국제공항은 "호빗: 스마우그의 폐허"에서 나오는 실제같은 "거대 독수리" 2개를 담은 새로운 설치작을 공개하였습니다. 이번 영화는 3부작 중 두 번째로, 세계 프리미어는 12월 2일 로스앤젤레스에서 열립니다. 한편, 에어 뉴질랜드는 자사 항공기 중 하나에 호빗의 주인공이 그려진 새로운 리버리를 공개하였습니다. 공항의 새로운 조각상은 웰링턴 Weta Workshop에서 제작되었습니다 - 이 회사는 "호빗"과 "반지의 제왕" 시리즈를 위한 소풍과 디자인 효과도 만들었습니다.
@highlight
웰링턴 국제공항, '호빗: 스마우그의 폐허'에서 나오는 '거대 독수리' 조각상 공개
@highlight
에어 뉴질랜드, 드래곤 스마우그가 그려진 새 리버리 공개
@highlight
"호빗" 3부작 모두 뉴질랜드에서 촬영됨 
감독 피터 잭슨은 "이번에 @placeholder가 큰 스크린을 벗어나 하늘을 날아다니는 것을 보는 것은 꽤 흥미롭습니다."라고 말합니다.
